# 2019/12/22
class Solution:
	def isPossibleDivide(self, nums, k: int) -> bool:
		if len(nums) % k > 0:
			return False
		dic={}
		for n in nums:
			if n not in dic:
				dic[n]=1
			else:
				dic[n]+=1
		while len(dic)>0:
			i=1
			head=min(list(dic.keys()))
			dic[head]-=1
			if dic[head]==0:
				del dic[head]
			while i<k:
				if head+1 in dic:
					head+=1
					dic[head]-=1
					if dic[head]==0:
						del dic[head]
				else:
					return False
				i+=1
		return True

